import Navbar from './components/Navbar'
import Hero from './components/Hero'
import Card from './components/Card'
import yourimage from './images/katie-zaferes.png'
function App() {
  return (
      <div>
          <Navbar/>
          <Hero/>
          <Card img={yourimage}
                rating="5.0"
                reviewCount={6}
                country="USA"
                tile = "Life Lessions with Katie Zaferes"
                price = {136}

          />
      </div>

  )
}

export default App;
